import React from 'react';

import Header from '../components/Header';
import MainMeals from '../components/MainMeals';
import Footer from '../components/Footer';
import '../styles/recipes.css';

function Food() {
  return (
    <div>
      <Header title="Comidas" isSearchable />
      <MainMeals />
      <Footer />
    </div>
  );
}
export default Food;
